package itwill.helljava.dto;

public class Trainer {
	private int trainer_no;
	private int member_no;
	private String trainer_profile_img;
	private String trainer_address1;
	private String trainer_addresss2;
	private String trainer_zip;
	
	public Trainer() {
		// TODO Auto-generated constructor stub
	}

	public int getTrainer_no() {
		return trainer_no;
	}

	public void setTrainer_no(int trainer_no) {
		this.trainer_no = trainer_no;
	}

	public int getMember_no() {
		return member_no;
	}

	public void setMember_no(int member_no) {
		this.member_no = member_no;
	}

	public String getTrainer_profile_img() {
		return trainer_profile_img;
	}

	public void setTrainer_profile_img(String trainer_profile_img) {
		this.trainer_profile_img = trainer_profile_img;
	}

	public String getTrainer_address1() {
		return trainer_address1;
	}

	public void setTrainer_address1(String trainer_address1) {
		this.trainer_address1 = trainer_address1;
	}

	public String getTrainer_addresss2() {
		return trainer_addresss2;
	}

	public void setTrainer_addresss2(String trainer_addresss2) {
		this.trainer_addresss2 = trainer_addresss2;
	}

	public String getTrainer_zip() {
		return trainer_zip;
	}

	public void setTrainer_zip(String trainer_zip) {
		this.trainer_zip = trainer_zip;
	}
	
}
